import React from 'react';
import { Fade } from 'react-awesome-reveal';

const Description = () => {
  return (
    <Fade>
      <div className='center_wrapper'>
        <h2>Highlights</h2>
        <div>Fade</div>
      </div>
    </Fade>
  );
};

export default Description;
